import { useEffect, useState} from "react"
import Button from 'react-bootstrap/Button';
import Card from 'react-bootstrap/Card';

const Students = ()=>{
const url = 'http://localhost:8080/v1/student'
const [students, setStudents] = useState([]);

const getDataStudents = async ()=> {
    const response = await fetch(url)
    const dataStudent = await response.json();
   setStudents(dataStudent.data);
   console.log(students);
}

useEffect(() =>{
    getDataStudents();
},[])

return (
    <div>
        <h1>My Students</h1>
        {students.map((siswa)=> <CardStud />)}

    </div>
)
}

function CardStud(){
    return(
        <div>
            <Card>
            <Card.Body>
                <Card.Title>Nama Siswa</Card.Title>

            </Card.Body>
            </Card>
            
        </div>
    )
}

export default Students;
